import React, {useState} from 'react';

function cadastrar() {

  const [meta, setMeta] = useState({
    name:'',
    description:'',
    status:''
  });

  const onChangeInput = e =>setMeta({...meta,[e.target.name]:e.target.value});
  const sendMeta = async e =>{
    e.preventDefault();
    console.log(meta);
  }

  return (
    <>
      <h1>Cadastrar minha meta.</h1>
      <hr/>
      <form onSubmit={sendMeta}>
        <label>Nome</label>
        <input 
          type="text" 
          name="name" 
          placeholder="Nome da meta" 
          onChange={onChangeInput}
        /> <br/> <br/>

        <label>Descrição</label>
        <input 
          type="text" 
          name="description" 
          placeholder="Descrição da meta" 
          onChange={onChangeInput}
        /><br/> <br/>

        <label>Status</label>
        <input 
          type="text" 
          name="status" 
          placeholder="Status da meta"
          onChange={onChangeInput}
        /><br/> <br/>

        <button type="submit">Cadastrar</button>
      </form>
    </>
  )
}

export async function getServerSideProps(){
  try {
    const response = await fetch(`http://localhost:8080/metas`);
    const data = await response.json();
    return {props:{data}}
  } catch (error) {
    return {
      notFound: true,
      error: `Dados não encontrados ${error}`
    } 
  }
  
}
export default cadastrar
